import React from 'react';
import './App.scss';
import Navbar from './components/Navbar'
import Home from './components/pages/Home'
import { Routes, Route } from 'react-router-dom'

function App() {
  return (
    <>
    <Routes>
      <Route path="/" element={Navbar} />
      <Route path="/home" element={Home} />
    </Routes>
    </>
  );
}

export default App;
